import 'bootstrap/dist/css/bootstrap.min.css';
import '../Landing.css';
import { useHistory } from 'react-router-dom';



const Landing = () => {

    let history = useHistory();

    return (
        <div>


            <header id="showcase">
                <h1 style={{ margin: '0px' }}> FlightiGo</h1>
                <div className='row'>
                    <div ><a  style={{ margin: '5px' }} onClick={() => { history.push("./welcome"); }} class="button">Login</a></div>
                    <div> <a  style={{ margin: '5px' }} onClick={() => { history.push("./register"); }} class="button">SignUp</a></div>
                </div>

            </header>

        </div>


    )
};

export default Landing;
